description:
Nederland
Thriller
87 minuten

goed

met Theo Maassen, Gijs Scholten van Aschat en Maryam Hassouni

Max (Theo Maassen) oefent al twintig jaar het vak van ambulancebroeder uit. Hij heeft geen vrouw, geen kinderen maar wel een 
buurvrouw als vriendin waar hij regelmatig mee scharrelt. Hij krijgt op een bepaald moment een nieuwe collega, een Marokkaans 
meisje waar hij goed mee overweg kan. Op een dag moeten ze met de ambulance naar een spoedbevalling maar een groep jongeren 
blokkeert de weg. Max slaat, daartoe mede aangezet door een tv-optreden van een beroemde cabaretier (Gijs Scholten van Aschat), 
op dat moment van zich af, waardoor juist de ellende begint.
